import './App.css';

function App() {
  return (
    <div className='bg-slate-200 w-full h-[100vh] flex items-center justify-center'>
        <div className='h-[80%] w-[40%] bg-white p-8 drop-shadow-md rounded-lg flex flex-col items-center gap-6  '>
            <h1 className='text-[32px] font-semibold text-slate-700'>Bank Mangement</h1>
        </div>

    </div>
  )
}

export default App;
